const instanceProjects=$("#instanceDataProjects"),userId=$("#userH1").data("id"),deltaT=a=>{for(let b=0;b<a.length;b++){const c=a[b],d=c.timeIn,e=c.timeOut,f=moment(d.split(" ").join("T")),g=moment(e.split(" ").join("T")),h=g.diff(f,"hours",!0);c.timeSpent=h}};$.get("/api/chartingInstances/all/"+userId).then(a=>{deltaT(a);for(let b=0;b<a.length;b++)instanceProjects.append(`<tr id="${a[b].id}">
        <td>${a[b].projectName}</td>
        <td>${a[b].timeIn}</td>
        <td>${a[b].timeOut}</td>
        <td>${a[b].timeSpent.toFixed(2)}</td>
        </tr>`)});